uploadtext:
Файлдарҙы йөкләү өсөн түбәндәге форманы ҡулланығыҙ.
Элек йөкләнгән файлдарҙы ҡарап сығыр өсөн [[Special:FileList|йөкләнгән файлдар исемлеген]] ҡарағыҙ. Файл йөкләүҙәр шулай уҡ [[Special:Log/upload|йөкләү яҙмаларына]], юйыуҙар иһә [[Special:Log/delete|юйыу яҙмаларына]] яҙылып бара.

Файлды мәҡәләгә өҫтәү өсөн түбәндәгеләрҙе ҡуллана алаһығыҙ:
* '''<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code>''' — файлдың тулы өлгөһөн ҡуйыр өсөн;
* '''<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|тасуирлама]]</nowiki></code>''' — файлдың киңлеге 200 нөктәгә тиклем бәләкәйләтелгән, һулға урынлаштырылған һәм аҫтында тасуирламаһы булған өлгөһөн ҡуйыр өсөн;
* '''<code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code>''' — файлды күрһәтмәйенсә, туранан-тура файлға һылтанма ҡуйыу өсөн.
